import logo from './logo.svg';
import './App.css';
import MultiselectD from './multiselect';
import React, { useState } from "react"

// function Popup(){
//   const [popup, setPopup] = useState(false)
//   return(

//   )
// }


function Class({ name, toggleModal }) {
  return (
    <button class="rounded-lg flex-auto  bg-white/70 w-4/5 self-center text-black" onClick={toggleModal}>{name}</button>
  )
}

function Tables({ number, toggleModal }) {
  const [modal, setModal] = useState(false);
  let components = []
  for (var i = 9 - number; i < 9; i++) {
    components.push(
      <div class="flex flex-col w-56 rounded-lg gap-2 h-full bg-white/70 m-4 pt-4 pb-5 drop-shadow-2xl">
        <div class="flex w-full rounded-t-lg flex-auto justify-center self-center">
          <span class="text-center self-center content-center text-black pb-2 font-bold text-lg">Semester {i}</span>
        </div>
        <Class name="Class 1" toggleModal={toggleModal}></Class>
        <Class name="Class 2" toggleModal={toggleModal}></Class>
        <Class name="Class 3" toggleModal={toggleModal}></Class>
        <Class name="Class 4" toggleModal={toggleModal}></Class>
        <Class name="Class 5" toggleModal={toggleModal}></Class>
        <Class name="Class 6" toggleModal={toggleModal}></Class>
        <Class name="Class 7" toggleModal={toggleModal}></Class>
      </div>
    )
  }
  return (components)
}

function App() {
  const [modal, setModal] = useState(true);
  const toggleModal = () => {
    setModal(!modal)
  }
  return (
    <div className="App h-screen flex flex-col font-nunito">
      <nav class="bg-teal-400 border-gray-200 dark:bg-gray-900 drop-shadow-2xl z-10">
        <div class="flex flex-wrap place-items-start mx-auto p-4 ml-5">
          <a class="flex">
            <img src="https://flowbite.com/docs/images/logo.svg" class="h-8 mr-3" alt="Flowbite Logo" />
            <span class="self-start text-2xl font-semibold whitespace-nowrap text-blue">PennPlan</span>
          </a>
        </div>
      </nav>

      <div class="flex flex-row h-full bg-gradient-to-br from-cyan-600 to-violet-400">
        <div class="flex flex-col align-center justify-center basis-1/4 drop-shadow-2xl">
          <div class="flex flex-col align-center justify-center basis-1/4 drop-shadow-2xl mx-6 my-4 bg-white/90 rounded-lg">
            <div class="p-6">Enter your preferences:</div>
            <div class="text-sm">Major</div>
            <select name="Major" class="mt-1 mb-3 w-2/3 self-center bg-gray-50 border border-lightGray text-black text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-45 p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500">
              <option disabled hidden selected class="text-black">Major</option>
              <option class="text-gray" value="CS">Computer Science (BSE)</option>
            </select>
            <div class="text-sm">Minor</div>
            <select name="Minor" class="mt-1 mb-3 w-2/3 self-center bg-gray-50 border border-lightGray text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-45 p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500">
              <option disabled hidden selected class="text-gray-900 text-sm ">Minor</option>
              <option value="CS">Computer Science</option>
            </select>
            <div class="text-sm">Semesters Remaining</div>
            <select name="Semesters" class="w-2/3 mt-1 mb-3 self-center bg-gray-50 border border-lightGray text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-45 p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500">
              <option disabled hidden selected class="text-gray-900 text-sm ">Semesters Remaining</option>
              <option value="1">1</option>
              <option value="2">2</option>
              <option value="3">3</option>
              <option value="4">4</option>
              <option value="5">5</option>
              <option value="6">6</option>
              <option value="7">7</option>
              <option value="8">8</option>
            </select>
            <div class="text-sm">Interests</div>
            <input type="text" id="default-input" class="mt-1 mb-3 w-2/3 self-center bg-gray-50 border border-lightGray text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-45 p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder='Interests' />
            <div class="text-sm">Classes Taken</div>
            <MultiselectD class="multiselect self-center"></MultiselectD>
            {/* <input type="text" id="default-input" class="my-3 self-center bg-gray-50 border border-lightGray text-gray-900 text-sm rounded-lg focus:ring-blue-500 focus:border-blue-500 block w-45 p-2.5 dark:bg-gray-700 dark:border-gray-600 dark:placeholder-gray-400 dark:text-white dark:focus:ring-blue-500 dark:focus:border-blue-500" placeholder='Classes taken'/> */}
            <button type="submit" class="my-3 self-center text-white bg-medBlue hover:bg-blue-800 focus:ring-4 focus:outline-none focus:ring-blue-300 font-medium rounded-lg text-sm w-32 sm:w-auto px-5 py-2.5 text-center dark:bg-blue-600 dark:hover:bg-blue-700 dark:focus:ring-blue-800">Submit</button>
          </div>
        </div>
        <div class="flex flex-col basis-3/4 bg-transparent p-14 relative ">
            {modal &&
              <div className="modal w-100 h-100 bg-white rounded-lg absolute inset-60 border-4 border-medBlue p-10 z-10 drop-shadow-2xl">
                <button class="absolute right-3 top-3 rounded-lg bg-medBlue text-white" onClick={toggleModal}>
                  <div class="m-1">Close</div></button>
                  <h1>Hello</h1>
                  <p>Blah blah blah blah blah</p>
              </div>
            }
          <div class="grow grid grid-rows-2 grid-flow-col auto-cols-max place-content-evenly items-stretch justify-center content-center bg-red gap-8">
            <Tables number={8} toggleModal={toggleModal}class="self-center"></Tables>
          </div>
        </div>
        {/* <div class="flex-auto w-32 ...">
          03
        </div> */}
      </div>
    </div>
  );
}

export default App;
